import React from 'react';
import './EntertainmentSection.css';



const EntertainmentSection = () => {
  return (
    <section className="entertainment">
      <h2>Giải Trí</h2>
      <div className="slideshow-container">
        <div className="slideshow-images">
          <img className="demo-img" src="%PUBLIC_URL%/images/billy2.jpg" alt="billi1" />
          <img className="demo-img" src="%PUBLIC_URL%/images/billy1.jpg" alt="billi2" />
          <img className="demo-img" src="%PUBLIC_URL%/images/billy3.jpg" alt="billi3" />
        </div>
        <a className="prev" onClick={() => plusSlides(-1)}>&#10094;</a>
        <a className="next" onClick={() => plusSlides(1)}>&#10095;</a>
      </div>
      <img className="demo-img" src="%PUBLIC_URL%/images/skypool.JPG" alt="skypool" />
      <h1 className="demo-text">Text next to image 1.</h1>
      <img className="demo-img" src="%PUBLIC_URL%/images/sauna.jpeg" alt="sauna" />
      <h1 className="demo-text">Text next to image 1.</h1>
    </section>
  );
};

export default EntertainmentSection;
